function CadasLog(){
    return (
        <div className="login-form-wrap">
          
              <div>
                  
                   <h2>Bem-Vindos</h2>
                   
                   <form className='login-form'>
                  <button type="submit" 
                          className='btn-login'>Cadastrar</button>
                  <button type="submit" 
                          className='btn-login'>Login</button>
                  </form>
                  
              </div>
          
        </div>
      );
    }
    
    export default CadasLog;
